function getRealData(){
    var data = [];
    var autoId = (function(){
        var id = 100;
        return function(){
            return id++
        }
    })()
    _.each(waterDataCollection, function(item, key){
        let regionName = key;
        let rivers = _.map(item.regions, function(wItem, wKey) {
            var rAttr = wItem.region_attributes;
            var tempId = autoId();
            var tempItem = {
                // id:regionName+wKey,
                id:(rAttr.flag == "1"?"lak_":"riv_")+tempId,
                coo:[_.map(wItem.shape_attributes.all_points_x, function(cItem, index){
                    return [cItem,wItem.shape_attributes.all_points_y[index]]
                })],
                type:rAttr.flag == "1"?"湖泊":"江河",
                area:rAttr.area,
                // 所属区域
                // district:regionName,
                district:"**省**市**区",
                // name :rAttr.river_name || "无",
                name :(rAttr.flag == "1"?"lak_":"riv_")+tempId,
                // name :regionName+" "+wKey,
                // owner:rAttr.person_name || "--",
                owner:(function(){
                    var nameNum = lastNames.length;
                    var tempLastName = lastNames[Math.floor(Math.random()*nameNum)];
                    return tempLastName + (Math.round(Math.random())?"**":"*");
                })(),
                phone:(function() {
     
                    var prefixArray = new Array("130", "131", "132", "133", "135", "137", "138", "170", "187", "189");
                    var i = parseInt(10 * Math.random());
                    var prefix = prefixArray[i];
                
                    for (var j = 0; j < 8; j++) {
                        prefix = prefix + Math.floor(Math.random() * 10);
                    }
                    var tempNumArr = prefix.split('');
                    (tempNumArr).splice(3,4,'****');
                    // prefix = prefix.replace(/{}/,'****')
                    // var x = document.getElementsByName("mobile_tel");
                    // for (var i = 0; i < x.length; i++) {
                    //     var o = x[i];
                    //     o.value = prefix;
                    // }
                    return tempNumArr.join('');
                }()),
                system:"--",
                // level:"l"+Math.floor(Math.random()*5+1),
                level:  ("l"+rAttr.quality_level) || "lo",
                exponent:(rAttr.index_average*1).toFixed(2),
                index_green:rAttr.index_green||"0",
                index_black:rAttr.index_black||"0",
                index_silt:rAttr.index_silt||"0",
                pType: (function(){
                    // var temp = [];
                    // if(rAttr.index_green != "0"){
                    //     temp.push("zl");
                    // }
                    // if(rAttr.index_black != "0"){
                    //     temp.push("hc");
                    // }
                    // if(rAttr.index_silt != "0"){
                    //     temp.push("ns");
                    // }
                    // return temp;
                    var temp = [
                        {label:"hc",value:rAttr.index_black},
                        {label:"ns",value:rAttr.index_silt},
                        {label:"zl",value:rAttr.index_green}
                    ]
                    if (rAttr.index_green*1>=60||rAttr.index_black*1>=60||rAttr.index_silt*1>=60) {
                        return [_.maxBy(temp,function(item,key){
                            return item.value*1
                        }).label]

                    } else {
                        return []
                    }
                }()),
                pArea:rAttr.area
            }
            return tempItem
        });
        data = data.concat(rivers);
    });
    

    return data;
}

